import React from 'react';
import logo from './logo.svg';
import './App.css';



const App = () => {
  return (
    <div className="App">
      <div><Welcome/></div>
      <ul>
        <li>css</li>
        <li>html</li>
        <li>js</li>
        <li>react</li>
      </ul>
    </div>
  );
}
const Welcome = () => { 
  return (
    <h1>Hello, IT-KAMASUTRA</h1>
  );
}

export default App;
